// src/App.js
import React from 'react';
import { Link } from 'react-router-dom';
import Home from '.pages/Home';

const App = () => {
  return (
    <div>
      <Link to="/">
        <button>Go to Home</button>
      </Link>
      <Home />
    </div>
  );
};

export default App;
